import React, { useState } from 'react'
import { data } from './data'

const UsebirthdayState = () => {
  const [people, setPeople] = useState(data)
  return (
    <>
      {people.map((person) => {
        const { id, name, age } = person
        return (
          <div>
            <h2>5 birthdays today</h2>
            <h4>{name}</h4>
            <h5>{age}</h5>
          </div>
        )
      })}
    </>
  )
}

export default UsebirthdayState
